        // List of unique classes
        const uniqueClasses = ["BER", "BRD", "BST", "CLR", "DRU", "ENC", "MAG", "MNK", "NEC", "PAL", "RNG", "ROG", "SHD", "SHM", "WAR", "WIZ"];
        
        // Currently selected classes (max 3)
        const selectedClasses = [];
        
        // Current display mode: 'all', 'selection', 'none'
        let currentMode = 'all';
        
        // Initialize the application
        function init() {
            createClassButtons();
            updateDisplay();
        }
        
        // Set up event listeners
        document.addEventListener('DOMContentLoaded', () => {
            // Mode buttons
            document.querySelectorAll('.mode-button').forEach(button => {
                button.addEventListener('click', () => {
                    document.querySelectorAll('.mode-button').forEach(btn => btn.classList.remove('active'));
                    button.classList.add('active');
                    currentMode = button.getAttribute('data-mode');
                    updateDisplay();
                });
            });
            
            init();
        });
        
        // Create class buttons
        function createClassButtons() {
            const classButtonsContainer = document.getElementById('classButtons');
            classButtonsContainer.innerHTML = '';
            
            uniqueClasses.forEach(className => {
                const button = document.createElement('button');
                button.className = 'class-button';
                button.textContent = className;
                button.addEventListener('click', () => toggleClass(className, button));
                classButtonsContainer.appendChild(button);
            });
        }
        
        // Toggle class selection
        function toggleClass(className, button) {
            const index = selectedClasses.indexOf(className);
            
            if (index === -1) {
                // Add class if not already selected and if less than 3 classes are selected
                if (selectedClasses.length < 3) {
                    selectedClasses.push(className);
                    button.classList.add('selected');
                }
            } else {
                // Remove class if already selected
                selectedClasses.splice(index, 1);
                button.classList.remove('selected');
            }
            
            updateDisplay();
        }
        
        // Update the display based on current mode and selected classes
        function updateDisplay() {
            const container = document.getElementById('abilitiesContainer');
            container.innerHTML = '';
            
            let filteredAbilities = [];
            
            if (currentMode === 'all') {
                filteredAbilities = abilities;
            } else if (currentMode === 'selection' && selectedClasses.length > 0) {
                filteredAbilities = abilities.filter(ability => {
                    // Check if the ability is available for all selected classes
                    if (ability.classes === 'ALL') return true;
                    
                    const abilityClasses = ability.classes.split(' ');
                    return selectedClasses.every(cls => abilityClasses.includes(cls));
                });
            }
            
            // Update stats
            const statsElement = document.getElementById('stats');
            if (currentMode === 'all') {
                statsElement.textContent = `Showing all abilities (${filteredAbilities.length})`;
            } else if (currentMode === 'none') {
                statsElement.textContent = 'No abilities selected';
            } else {
                statsElement.textContent = `Showing abilities for ${selectedClasses.join(', ')} (${filteredAbilities.length})`;
            }
            
            // Display abilities or message
            if (filteredAbilities.length === 0 && currentMode !== 'none') {
                const noAbilities = document.createElement('div');
                noAbilities.className = 'no-abilities';
                noAbilities.textContent = 'No abilities found for the selected classes.';
                container.appendChild(noAbilities);
            } else if (currentMode === 'none') {
                const noAbilities = document.createElement('div');
                noAbilities.className = 'no-abilities';
                noAbilities.textContent = 'Select "All Abilities" or choose specific classes to view abilities.';
                container.appendChild(noAbilities);
            } else {
                filteredAbilities.forEach(ability => {
                    container.appendChild(createAbilityCard(ability));
                });
            }
        }
        
        // Create an ability card
        function createAbilityCard(ability) {
            const card = document.createElement('div');
            card.className = 'ability-card';
            
            // Extract ability name without the class info in parentheses
            let displayName = ability.name;
            const parenthesesIndex = displayName.indexOf('(');
            if (parenthesesIndex !== -1) {
                displayName = displayName.substring(0, parenthesesIndex).trim();
            }
            
            // Create card content
            const nameElement = document.createElement('h3');
            nameElement.className = 'ability-name';
            nameElement.textContent = displayName;
            
            const classesElement = document.createElement('div');
            classesElement.className = 'ability-classes';
            classesElement.textContent = `Available to: ${ability.classes === 'ALL' ? 'All Classes' : ability.classes}`;
            
            card.appendChild(nameElement);
            card.appendChild(classesElement);
            
            // Process and add ability details
            const detailsElement = document.createElement('div');
            detailsElement.className = 'ability-details';
            detailsElement.innerHTML = processAbilityDetails(ability.details);
            card.appendChild(detailsElement);
            
            return card;
        }
        
        // Process ability details to format them nicely
        function processAbilityDetails(details) {
            // Extract description and ranks
            const lines = details.split('\n');
            
            let description = '';
            let ranks = [];
            let currentSection = 'description';
            
            for (const line of lines) {
                const trimmedLine = line.trim();
                if (trimmedLine === '') continue;
                
                if (trimmedLine.startsWith('Ability ID:') || trimmedLine.startsWith('Rank')) {
                    currentSection = 'ranks';
                }
                
                if (currentSection === 'description') {
                    description += trimmedLine + ' ';
                } else {
                    ranks.push(trimmedLine);
                }
            }
            
            // Create HTML for description and ranks
            let html = `<div class="ability-description">${description.trim()}</div>`;
            
            if (ranks.length > 0) {
                html += '<div class="ability-ranks">';
                
                for (const rank of ranks) {
                    if (rank.startsWith('Ability ID:')) {
                        html += `<div class="rank ability-id">${rank}</div>`;
                    } else if (rank.startsWith('Rank')) {
                        // Extract rank number, cost, and effect
                        const rankMatch = rank.match(/Rank (\d+) \(ID \d+\) costs (\d+) AA with effect: (.*)/);
                        if (rankMatch) {
                            const [, rankNum, cost, effect] = rankMatch;
                            html += `
                                <div class="rank">
                                    <span class="rank-header">Rank ${rankNum} (${cost} AA):</span>
                                    <span class="rank-effect">${effect}</span>
                                </div>
                            `;
                        } else {
                            html += `<div class="rank">${rank}</div>`;
                        }
                    } else {
                        html += `<div class="rank">${rank}</div>`;
                    }
                }
                
                html += '</div>';
            }
            
            return html;
        }
    
